import React from 'react';
function ClientForm(){
    return (
        <div>
        <form action ="/client/new/process" method="POST">
            <label>Name</label>
            <input type="text" placeholder="name" name="name"/><br/>
            <label>Address</label>
            <input type ="text" placeholder="52 Vine Ave" name ="address"/>
            <label>City</label>
            <input type ="text" placeholder="Bloomfield" name ="city"/>
            <label>Email</label>
            <input type ="text" placeholder="xxx@gmail.com" name ="email"/>
            <label>Zip</label>
            <input type ="text" placeholder="01234" name ="zip"/>
        </form>
</div>
    )
}
export default ClientForm;
